import request from "apis/square/AxiosInstanceSquare";
import { ResFetchCoffee } from "./SquareAPITypes";

export function fetchCoffee() {
  const TARGET_API_URL = "https://api.sampleapis.com/coffee/hot";
  return request<ResFetchCoffee>({
    url: `${TARGET_API_URL}`,
    method: "get",
  });
}
